import React, {useState} from 'react';
import Header from './components/Header';
import Home from './components/Home';

function App() {

  const [inProfile, setInProfile] = useState(false);

  return (
    <React.Fragment>
      <Header />
      {!inProfile && <Home />}

    </React.Fragment>
  );
}

export default App;
